('ASUS ProArt P16 H7606W-IME038WSM', 'ProArt P16 was designed with one goal in mind: to give you all the raw performance you need to handle even the toughest, most resource-hungry projects. Featuring the AMD Ryzenu2122 AI 9 HX 370 processor and NVIDIA GeForce RTX 4070 graphics to give you all the raw performance you need to handle even the toughest, most resource-hungry projects.\r\nTo streamline your creative workflows, your laptop needs to be an extension of yourself. ProArt P16 incorporates several hardware features such as 3-button touchpad, customized keys, Touchpad stylus support. Crafted for creators, to give you intuitive, precise control over every action.', 'ASUS ProArt P16 (H7606W-IME038WSM).jpg', 'Ryzen AI 9 HX 370', 'AMD', 18117, 'GeForce RTX 4070 8GB GDDR6', ' NVIDIA', 12400, 32768, NULL, 2097152, 'M2 SSD DDR5', NULL, NULL, 3840, 2400, NULL, NULL, 60, 2, 0, 0, 1),
('ASUS Vivobook Pro 15 OLED N6506M-VMA029WS', 'Powered by the Intelu00ae Coreu2122 Ultra 7 155H with a dedicated NPU for AI computing, and NVIDIAu00ae Geforce RTXu2122 4060 Laptop GPU, also achieving up to 125-watt (CPU+GPU) TDP continuously in full-speed mode.\r\nASUS IceCool Pro thermal technology allows your laptop to run at a blistering 125 W total TDP in full-speed mode. With 103-blade, 2 fans, 3 vents and 5 pipes and the four fan modes in the MyASUS, you can effortlessly switch for different purposes.\r\n', 'ASUS Vivobook Pro 15 OLED (N6506M-VMA029WS).jpg', 'Core Ultra 7 155H', 'INTEL', 12612, 'GeForce RTX 4060 8GB GDDR6', ' NVIDIA', 8708, 8192, 24576, 1048576, 'M2 SSD DDR5', NULL, NULL, 2880, 1620, NULL, NULL, 120, NULL, 0, 1, 0),
