('ASUS Vivobook 16', 'Everything is smoother with the powerful ASUS Vivobook 16, the feature-packed laptop with user-friendly features including a 180u00b0 lay-flat hinge, a physical webcam shield and dedicated function keys to turn your mic on or off. Your health is in safe hands with ASUS Antimicrobial Guard Plus protecting frequently-touched surfaces, and the bigger touchpad is now more finger-friendly. Enjoy the smooth power of Vivobook 16!\r\n\r\nWindows 11 Home - ASUS recommends Windows 11 Home for business\r\nUp to Intelu00ae Coreu2122 5 Series 1 processor\r\nUp to 16u201d NanoEdge display\r\nUp to 16 GB DDR4 memory\r\nUp to 512 GB SSD storage\r\nOptional fingerprint login sensor\r\nASUS Antimicrobial Guard Plus\r\nMilitary-Grade durability', 'ASUS Vivobook 16.png', 'Core 5 Processor 120U', 'INTEL', 5155, 'Integrated Graphics', 'INTEL', 1600, 16384, NULL, 524288, 'M2 SSD DDR5', NULL, NULL, 1920, 1200, NULL, NULL, NULL, NULL, 0, 1, 0),
('Acer Aspire 3', 'Choose the ready-to-go Aspire 3 with the latest Intelu00ae Coreu2122 i3 N-Series Processors1 made for practical multitasking and productivity. With ease-of-use at its core, this family-friendly laptop is ready when you are.', 'Acer Aspire 3.avif', 'i3-1215U', 'INTEL', 6752, 'UHD Graphics', 'INTEL', 139, 4096, NULL, 262144, 'M2 SSD DDR5', NULL, NULL, 1920, 1080, NULL, NULL, 60, NULL, 0, 1, 0),
('ROG Zephyrus G16 2024 GU605', 'Storage\r\nGames, applications, and large files load at warp speed on an ultrafast PCIeu00ae 4.0 SSD. Up to 2TB of storage leaves loads of room for creative apps and tons of games, with space to spare for your professional portfolio.\r\n\r\nUp to\r\n\r\n2TB PCIeu00ae 4.0\r\n\r\nSSD storage\r\n\r\nA stylized 3D image of a laptop motherboard, with the routing between the CPU, GPU, MUX Switch, and display highlighted.\r\nMUX Switch with NVIDIA Advanced Optimus\r\nWith NVIDIAu00ae Advanced Optimus, the laptop can automatically route frames from the discrete GPU directly to the display using a MUX Switch, bypassing the integrated graphics. This pathing improves performance by 5-10% compared to machines without a MUX Switch, making sure you get the absolute best gaming experience u2014 all without needing touch a single button.\r\n\r\nA stylized 2D wireframe image of a RAM module. - original picture\r\nA stylized 2D wireframe image of a RAM module. - effected picture\r\nMemory\r\nBoasting up to a 32GB capacity normally reserved for high-end workstations ultra-fast 7467 MHz memory allows the Zephyrus G16 to multitask with ease.\r\n\r\n*Rated speed of RAM module. Actual memory speeds may vary by CPU configuration.', 'ROG Zephyrus G16 2024 GU605.jpg', 'Core Ultra 7 155H', 'INTEL', 13270, 'GeForce RTX 4060', 'INTEL', 7600, 16384, 32768, 1048576, 'M2 SSD DDR5', 2097152, 'M2 SSD DDR5', 2560, 1600, NULL, NULL, 60, NULL, 0, 1, 0),
('Lenovo Legion Pro 7i 16 Gen 9', 'AI-Powered. Vapor Chamber Cooled. Conquer Your Arena.\r\nPlay with an edge on the competition with Legion&''s best-in-class AI tuning via Lenovo AI Engine+.\r\n\r\nUp to Windows 11 Pro\r\n\r\nExperience searing processing power with Intelu00ae Coreu2122 processors &amp; 40 Series NVIDIAu00ae GeForce RTXu2122 GPUs\r\n\r\nEnjoy all-day gaming with a massive battery &amp; Legion ColdFront: Vaporu 2019s advanced \r\n\r\ncooling system\r\n\r\nGet fully immersed with our Lenovo PureSight 16u2033 WQXGA Gaming display a Legion TrueStrike keyboard with per-key RGB\r\n\r\nEmbrace sustainability from recycled aluminum and magnesium, cast in stylish Eclipse Black.\r\n\r\n', 'Legion Pro 7i 16 Gen 9.avif', 'i9-14900HX', 'INTEL', 19949, 'GeForce RT 4080', ' NVIDIA', 19019, 32768, 65536, 2097152, 'M2 SSD DDR5', 4194304, 'M2 SSD DDR5', 2560, 1600, NULL, NULL, 60, NULL, 1, 0, 1),
('ASUS TUF GAMING A15', 'Geared for serious gaming and rocking a slick new style, TUF Gaming A15 is a feature-packed Windows 11 Home gaming laptop with the power to carry you to victory. The new GeForce RTXu2122 3050 GPU delivers fluid gameplay on up to a 144Hz display with 100% sRGB, while the potent AMD Ryzenu2122 7 CPU is bolstered by improved cooling that amps CPU performance and keeps acoustics stealthy. A long-lasting 90Wh battery coupled with TUFu2019s military-grade durability keeps you on your best game anywhere.', 'ASUS TUF GAMING A15.webp', 'Ryzen 7 7435HS', 'AMD', 7800, 'GeForce RTX 3050 8GB GDDR6', ' NVIDIA', 4200, 8192, 16384, 524288, 'M2 SSD DDR5', NULL, NULL, 1920, 1080, NULL, NULL, 144, NULL, 1, 0, 0),
